import React from "react";

export default function SplitGender(props) {
  return props.data
    .sort()
    .map((baby) =>
      baby.sex === "m" ? (
        <span className="babyBoy">{baby.name}</span>
      ) : (
        <span className="babyGirl">{baby.name}</span>
      )
    );
}
